var tipuesearch = {"pages": [{'title': 'About', 'text': '網站倉儲: https://40923149r.github.io/cd2022/content/index.html \n 課程網誌: https://github.com/40923149r/cd2022 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Note', 'text': '', 'tags': '', 'url': 'Note.html'}, {'title': '建立倉儲', 'text': '先進去老師倉儲的cmsimde site， 複製網址 \n \n 到Create a new repository點開import a repository \n \n 貼上剛剛複製的網址，Repository Name設為 cd2022 \n \n 接著到小黑窗 \n cd tmp \n git clone --recurse-submodules https://github.com/a40923101/cd2022.git \n cd cd2022 \n cms \n 複製網址  https://127.0.0.1:9443/  就可以開啟倉儲了。 \n', 'tags': '', 'url': '建立倉儲.html'}, {'title': 'Wink上傳', 'text': '先複製下面文字 \n <script> var winkVideoData = { dataVersion: 1, frameRate: 20, buttonFrameLength: 10, buttonFrameOffset: 5, frameStops: { }, }; // ]]></script> \n 到自己影片點右鍵再按檢視網頁原始碼 \n \n 複製框框的內容 \n \n 修改以下東西 \n', 'tags': '', 'url': 'Wink上傳.html'}, {'title': 'Leo', 'text': '在小黑窗打 \n cd cd2022 \n leo \n \n 進到leo，接著點選 File裡面的Open-Outline \n \n 接著開啟 cd2022的config裡面的pelican \n \n 修改裡面原有的資料，改成 自己的學號和標題 \n \n 這裡網址也都改成自己倉儲 \n \n 修改自己要的標題資訊 \n \n 修改好後對local-blog按下右鍵，在按下Goto Script \n \n 在小黑窗打上 \n cd cd2022\xa0 \n pelican markdown -o blog -s local_publishconf.py \n 第一次打會出現一個錯誤，需要再cd2022的markdown裡面加個images的資料夾就可以解決錯誤。 \n \n', 'tags': '', 'url': 'Leo.html'}, {'title': 'HW', 'text': '', 'tags': '', 'url': 'HW.html'}, {'title': 'W3', 'text': '25. \n \n \n \n \n \n   \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W3.html'}, {'title': '遠距教學', 'text': '今天將測試是否使用 Microsoft Teams 上課, 而不是採用 Google Meet。先申請 onedirve 帳號 \n \n 進入 teams ，利用 team code: bp9x4jy 進入 general channel。 \n \n \n', 'tags': '', 'url': '遠距教學.html'}, {'title': '測試', 'text': '123 \n \n \n \n', 'tags': '', 'url': '測試.html'}]};